import logo from "./logo.svg"
import "./App.css"
import axios from "axios"
import { Component } from "react"

class App extends Component {
    constructor(props) {
        super(props)
        this.state = {
            //state
            users: [],
        }
    }

    componentWillUnmount() {
        axios("https://randomuser.me/documentation")
    }
}

export default App
